import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import * as ROUTES from './config/router';
import {Home, Browse, SignIn, SignUp} from './pages';
import useAuth, {AuthProvider} from './helpers/useAuth';
import { IsUserRedirect, ProtectedRoute } from './helpers/routes';
//import {HeaderContainer} from './containers/header';


function RouteSite() {

  const {isLogin} = useAuth();

  return (
    <Router>
      <Routes>
        {/* <Route path={ROUTES.HOME} element={<Home/>}/>
        <Route path={ROUTES.BROWSE} element={<Browse/>}/>
        <Route path={ROUTES.SIGN_IN} element={<SignIn/>}/>
        <Route path={ROUTES.SIGN_UP} element={<SignUp/>}/> */}
        <IsUserRedirect isLogin={isLogin} loggedInPath={ROUTES.BROWSE} path={ROUTES.SIGN_IN}>
          <SignIn />
        </IsUserRedirect>
        <IsUserRedirect isLogin={isLogin} loggedInPath={ROUTES.BROWSE} path={ROUTES.SIGN_UP}>
          <SignUp />
        </IsUserRedirect>
        <ProtectedRoute isLogin={isLogin} path={ROUTES.BROWSE}>
          <Browse />
        </ProtectedRoute>
        <IsUserRedirect isLogin={isLogin} loggedInPath={ROUTES.BROWSE} path={ROUTES.HOME}>
          <Home />
        </IsUserRedirect>
      </Routes>
    </Router>
  )
}

function App() {

  return (

      <AuthProvider>
        <RouteSite/>
      </AuthProvider>

  );
}



export default App;
